  /**
   * 添加地址
   */
  doadd: function (e) {
    console.log(e, "doadd");

    var aRess = e.detail.value.detailadd
    var aName = e.detail.value.name
    var aTel = e.detail.value.phone;
    var add = this.data.region;
    var seletdadd = this.data.region;
    var add = this.data.regionList;
    console.log(this.data, 'add')
    var aPid = 0;
    var aCid = 0;
    var aDid = 0;
    var a1 = seletdadd[0];
    var a2 = seletdadd[1];
    var a3 = seletdadd[2];

    for (var s in add) {
      if (a1 == add[s]['p_name']) {
        aPid = add[s]['p_id'];
        for (var c in add[s]['p_city']) {
          if (a2 == add[s]['p_city'][c]['c_name']) {
            aCid = add[s]['p_city'][c]['c_id'];
            for (var d in add[s]['p_city'][c]['p_district']) {
              if (a3 == add[s]['p_city'][c]['p_district'][d]['d_name']) {
                aDid = add[s]['p_city'][c]['p_district'][d]['d_id'];
              }
            }
          }
        }
      }
    }

    if (aName == "") {
      util.showModal('请输入收货人姓名');
      return false;
    }
    if (aTel == "") {
      util.showModal('请输入员工手机号');
      return false;
    }
    if (aRess == "") {
      util.showModal('请输入详细地址');
      return false;
    }
    wx.showLoading({
      title: '添加中',
    });
    let succ = function (res) {
      console.log(res.data, '登录结果')
      if (res.data.value == 1) {
        console.log('成功');
        wx.redirectTo({
          url: '/pages/myCenter/add/index'
        })
      } else {
        util.showModal('添加失败');
        wx.hideLoading();
      }
    }

    util.request(
      'https://ssl.huoyuan.mobi/xsys/xlogin.php',
      {
        aName: aName,
        aTel: aTel,
        aRess: aRess,
        aPid: aPid,
        aCid: aCid,
        aDid: aDid,
      }, succ
    )
  }
